import React from 'react';
import {addPostActionCreator, updateNewPostChangeActionCreator} from "../../../Redax/Profile-reducer";
import MyPosts from "./MyPosts";

const MyPostsContainer = (props) => {

    let state = props.store.getState();

    


    let addPost = () => {
        props.store.dispatch(addPostActionCreator());
    };

    let onPostChange = (text) => {
        let action = updateNewPostChangeActionCreator(text);
        props.store.dispatch(action);
    };

    return ( <MyPosts updateNewPostChange = {onPostChange} addPost={addPost} posts={props.posts} />)
}

export default MyPostsContainer;
